import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart"; // Elegant shopping cart icon

export default function NavigationBar() {
  const [activeSection, setActiveSection] = React.useState("Welcome");

  const renderContent = () => {
    // Map each button to its respective content
    switch (activeSection) {
      case "Venues":
        return <Box sx={{ p: 4 }}>Content for Venues</Box>;
      case "Hair":
        return <Box sx={{ p: 4 }}>Content for Hair</Box>;
      case "Makeup":
        return <Box sx={{ p: 4 }}>Content for Makeup</Box>;
      case "Photographers":
        return <Box sx={{ p: 4 }}>Content for Photographers</Box>;
      case "Music":
        return <Box sx={{ p: 4 }}>Content for Music</Box>;
      case "Florist":
        return <Box sx={{ p: 4 }}>Content for Florist</Box>;
      case "Dresser":
        return <Box sx={{ p: 4 }}>Content for Dresser</Box>;
      case "Planner":
        return <Box sx={{ p: 4 }}>Content for Planner</Box>;
      default:
        return <Box sx={{ p: 4 }}>Welcome! Select a section to view its content.</Box>;
    }
  };

  return (
    <Box>
      <AppBar position="static" color="default" elevation={1} sx={{ backgroundColor: "#fff" }}>
        <Toolbar
          sx={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            paddingX: 4,
          }}
        >
          {/* Logo on the Left */}
          <Box
            sx={{
              textDecoration: "none",
              color: "inherit",
              display: "flex",
              alignItems: "center",
              gap: "10px",
            }}
          >
            <Box
              sx={{
                width: 40,
                height: 40,
                backgroundColor: "#ccc",
                borderRadius: "50%",
              }}
            />
            <Typography
              variant="h6"
              sx={{
                fontWeight: "bold",
                textTransform: "uppercase",
              }}
            >
              Logo Placeholder
            </Typography>
          </Box>

          {/* Navigation Links */}
          <Box
            sx={{
              display: "flex",
              gap: 3,
            }}
          >
            {[
              "Venues",
              "Hair",
              "Makeup",
              "Photographers",
              "Music",
              "Florist",
              "Dresser",
              "Planner",
            ].map((section) => (
              <Button
                key={section}
                onClick={() => setActiveSection(section)}
                color="inherit"
                sx={{ textTransform: "uppercase", fontWeight: 500, fontSize: "14px" }}
              >
                {section}
              </Button>
            ))}
          </Box>

          {/* Classy Shopping Cart Icon on the Right */}
          <IconButton
            color="inherit"
            sx={{
              padding: 1,
            }}
          >
            <ShoppingCartIcon sx={{ fontSize: "28px", color: "#000" }} />
          </IconButton>
        </Toolbar>
      </AppBar>

      {/* Dynamic Content Section */}
      <Box
        sx={{
          mt: 4,
          p: 2,
          border: "1px solid #ccc",
          borderRadius: 2,
          minHeight: "200px",
        }}
      >
        {renderContent()}
      </Box>
    </Box>
  );
}
